import React from "react";

function SettingAds(props) {
  return (
    <div className="seting-center">
      <div className="seting-center-scroll" id="seting-center-scroll-style">
        <div className="seting-center-scroll-nav">Cài đặt chung cho tài khoản</div>
        <div className="seting-center-scroll-content"></div>
      </div>
    </div>
  );
}

export default SettingAds;
